import axios from 'axios'
import { useEffect, useState } from 'react'
import { instance } from '../services'
import { getInformationKor } from './getInformationKor'

function GetDataFromSoldOut({submitCode}) {
    const [data, setData] = useState([])
    useEffect(
        () => {
            const fetchApi = async () => {
                const data = await getInformationKor(submitCode)
                // const responeData = data.data.data.product_info.list;
                setData(data)    
            }
            fetchApi();
        }, [submitCode]
    )

    // 
    return (
        <div>

        </div>
    )
}
export default GetDataFromSoldOut;
